from typing import List

class Solution:
  def findMaxConsecutiveOnes(self, nums: List[int]) -> int:
    maxCount = 0
    
    # leftCount = 0
    # rightCount = 0
    i = 0
    for i in range(i, len(nums)):
      count = 0
      index = i
      flipped = False
      while index < len(nums):
        if nums[index] == 0 and flipped == False:
          flipped = True
        elif nums[index] == 0:
          i = index
          break
        count += 1
        index += 1
      if count > maxCount:
        maxCount = count
      # if rightCount > 0:
      #   if num == 1:
      #     rightCount += 1
      #   else: 
      #     leftCount = rightCount - 1
      #     rightCount = 0
      # else:
      #   if num == 1:
      #     leftCount += 1
      #   elif rightCount == 0:
      #     rightCount += 1
      # if leftCount + rightCount > maxCount:
      #   maxCount = leftCount + rightCount
        
    return maxCount

solution = Solution()
